import React, {useEffect, useState} from "react";

function App() {
    const [data, setData] = useState();

    useEffect(() => {
        fetch('/api')
            .then(res =>
                res.json()
            )
            .then(res =>
                setData(res)
            )
    }, [])

    return (
      <div>
          <h1>Hello</h1>
      </div>
    )
}

export default App;
